import React,{Component} from 'react';


class BillView extends Component
{
    render() {
        return(
            <div style={title}>
                <h2>Receipt</h2>
                <div style={body}>
                    <table style={tableStyle}>
                        <tbody>
                        <tr style={cellStyle}>
                            <td style={HeadStyle}>
                                <label><b>Ticket ID</b></label>
                            </td>
                        </tr>
                          <tr style={cellStyle}>
                              <td style={HeadStyle}>
                                  <label><b>From</b></label>
                              </td>
                          </tr>
                          <tr style={cellStyle}>
                              <td style={HeadStyle}>
                                  <label><b>To</b></label>
                              </td>
                          </tr>
                        <tr style={cellStyle}>
                            <td style={cellStyle}>
                                <label><b>Number of tickets</b></label>
                            </td>
                        </tr>
                          <tr style={cellStyle}>
                              <td style={cellStyle}>
                                  <label><b>Total Ticket Price</b></label>
                              </td>
                          </tr>
                        </tbody>
                    </table>
                </div>
            </div>
        );

    }
}
const title={
    textAlign:"center"
};
const body={
   fontSize:"25px",
   left:"1200px",
   textAlign:"left",
   right:"1200px"
};
const tableStyle={
    width:"500px",
    marginLeft:'10%',
    marginRight:'10%',
    border: '1px solid black'
};

const cellStyle={
    height:'60px',
    border: '1px solid black'
};
const HeadStyle={
    height:'60px',
    border: '1px solid black',
    backgroundColor:"Blue",
    fontColor:"white"
};
export default BillView
